                                    subheader={
                                        <ListSubheader component="div" id="nested-list-subheader">
                                            Nested List Items
                                        </ListSubheader>
                                    }>
                                    <ListItemButton>
                                        {/*<ListItemIcon>*/}
                                        {/*<SendIcon />*/}
                                        {/*</ListItemIcon>*/}
                                        <ListItemText primary="Sent mail" />
                                    </ListItemButton>
                                    <ListItemButton>
                                        <ListItemIcon>
                                            {/*<DraftsIcon />*/}
                                        </ListItemIcon>
                                        <ListItemText primary="Drafts" />
                                    </ListItemButton>
                                    <ListItemButton onClick={handleClick}>
                                        <ListItemIcon>
                                            {/*<InboxIcon />*/}
                                        </ListItemIcon>
                                        <ListItemText primary="Inbox" />
                                    </ListItemButton>

                                </List>
                            </Card>
                        </Grid>


                    })
                }
            </Grid>
        </Card>
    )
}
export default Main
